import React, { useState, useEffect } from "react";
import {
  View,
  Text,
  TouchableOpacity,
  Pressable,
  Image,
  ImageBackground,
  StyleSheet,
  StatusBar,
  KeyboardAvoidingView,
  Dimensions,
  TouchableWithoutFeedback,
  Keyboard,
  Alert,
} from "react-native";
import { Checkbox } from "react-native-elements";
import { TextInput,Button } from "react-native-paper";
import { SvgXml } from "react-native-svg";
const screenHeight = Dimensions.get("window").height;
const screenWidth = Dimensions.get("window").width;
const RegisterScreen = ({ navigation }) => {
  const svgLogo =`<svg width="154" height="52" viewBox="0 0 154 52" fill="none" xmlns="http://www.w3.org/2000/svg" xmlns:xlink="http://www.w3.org/1999/xlink">
  <rect width="154" height="52" fill="url(#pattern0)"/>
  <defs>
  <pattern id="pattern0" patternContentUnits="objectBoundingBox" width="1" height="1">
  <use xlink:href="#image0_891_49" transform="matrix(0.000943963 0 0 0.00279558 0 -1.01923)"/>
  </pattern>
  <image id="image0_891_49" width="1080" height="1080" xlink:href="data:image/png;base64,"/>
  </defs>
  </svg>`
  const [username, setUsername] = useState("");
  const [email, setEmail] = useState("");
  const [password, setPassword] = useState("");
  const handleUsername = (username) => {
    setIsFilleduname(true)
    setUsername(username);
  };
  const handleEmail = (email) => {
    setIsFilledEmail(true)
    setEmail(email);
  };
  const handlePassword = (password) => {
    setIsFilledPassword(true)
    setPassword(password);
  };

  const [isFilleduname,setIsFilleduname] = useState(true)
  const [isFilledEmail,setIsFilledEmail] = useState(true)
  const [isFilledPassword,setIsFilledPassword] = useState(true)

  const myFct = () => {

    if(username=== '' && email === '' && password === ''){
      // alert('check your input fields')
      setIsFilledEmail(false)
      setIsFilledPassword(false)
      setIsFilleduname(false)
      return
    }
    if(username === ''){
      setIsFilleduname(false)
      return
    }
    if(email === ''){
      setIsFilledEmail(false)
      return
    }
    if(password===''){
      setIsFilledPassword(false)
      return
    }
      navigation.navigate("OnBoarding",{ uname:username,email:email,pword:password   })
  }
  return (
    <ImageBackground
      source={require("../images/startScreenBackground.png")}
      style={styles.background}
    >
      <StatusBar barStyle='dark-content' />

      <KeyboardAvoidingView>
        <TouchableWithoutFeedback onPress={() => Keyboard.dismiss()}>
          <View style={styles.content}>
            <SvgXml xml={svgLogo}/>
            <View style={{ gap: 15 }}>
              <View style={{gap:5}}>
              <TextInput
                label="Username"
                mode="outlined"
                style={{ width: 250, height: 40 }}
                theme={{
                  colors: {
                    primary: "#03ba55",
                    text: "red",
                    placeholder: "grey",
                    background: "#fff",
                    onSurfaceVariant: "grey",
                    //working
                    outline: isFilleduname ===false? "#ba1629" : "grey",
                  },
                }}
                value={username}
                onChangeText={handleUsername}
                //textColor="red"
              />
              {!isFilleduname ? (
        <Text style={{color:"#ba1629"}}>Username is required</Text>
      ) : null}
              </View>
              
              <View style={{gap:5}}>
              <TextInput
                label="Email"
                mode="outlined"
                style={{ width: 250, height: 40 }}
                theme={{
                  colors: {
                    primary: "#03ba55",
                    text: "red",
                    placeholder: "grey",
                    background: "#fff",
                    onSurfaceVariant: "grey",
                    //working
                    outline: isFilledEmail ===false? "#ba1629" : "grey",
                  },
                }}
                keyboardType="email-address"
                //textColor="red"
                value={email}
                onChangeText={handleEmail}
              />
              {!isFilledEmail ? (
        <Text style={{color:"#ba1629"}}>Email is required</Text>
      ) : null}
              </View>
              <View style={{gap:5}}>
              <TextInput
                secureTextEntry={true}
                label="Password"
                mode="outlined"
                style={{ width: 250, height: 40 }}
                theme={{
                  colors: {
                    primary: "#03ba55",
                    text: "red",
                    placeholder: "grey",
                    background: "#fff",
                    onSurfaceVariant: "grey",
                    //working
                    outline: isFilledPassword === false ? "#ba1629" : "grey",
                  },
                  
                }}
                value={password}
                onChangeText={handlePassword}
                //textColor="red"
              />
              {!isFilledPassword ? (
        <Text style={{color:"#ba1629"}}>Password is required</Text>
      ) : null}
              </View>
              
            </View>
            <View style={{ gap: 10 }}>
              <TouchableOpacity
                style={styles.registerbtn}
                onPress={myFct}
                  //navigation.navigate("OnBoarding");
                
              >
                <Text
                  style={{
                    textAlign: "center",
                    textTransform: "uppercase",
                    fontWeight: "700",
                    color: "#fff",
                    fontSize: 16,
                  }}
                >
                  sign up
                </Text>
              </TouchableOpacity>
              <View style={{ flexDirection: "row", justifyContent: "center" }}>
                <Text>Already have an account? </Text>
                <TouchableOpacity
                  onPress={() => navigation.navigate("LoginScreen")}
                >
                  <Text style={{ color: "#03ba55" }}>Log In</Text>
                </TouchableOpacity>
              </View>
            </View>
          </View>
        </TouchableWithoutFeedback>
      </KeyboardAvoidingView>
    </ImageBackground>
  );
};

export default RegisterScreen;

const styles = StyleSheet.create({
  background: {
    flex: 1,
    resizeMode: "contain",
    backgroundColor: "#1E2A23",
    justifyContent: "center",
    alignItems: "center",
  },
  content: {
    backgroundColor: "white",
    borderRadius: 10,
    height: screenHeight - 250,
    width: screenWidth - 70,
    justifyContent: "center",
    alignItems: "center",
    gap: 20,
  },
  registerbtn: {
    backgroundColor: "#03ba55",
    width: 250,
    paddingVertical: 15,
    alignItems: "center",
    justifyContent: "center",
    borderRadius: 5,
  },
});
